import React from "react";

function ChatHeader(){
    return(
        <div className="chatHeader">

            <div className="chatHeaderLeft">
                <h3>
                    <span className="chatHeader__hash">#</span>
                    STUDYING
                </h3>
            </div>

            <div className="chatHeaderRight">
                {/* Poner iconos */}
            </div>


        </div>


    )
}

export default ChatHeader;
